import { EventsList } from "../components";

function EventsPage() {
  useEffect(() => {
    async function fetchEvents() {}

    fetchEvents();
  }, []);
  return (
    <>
      <EventsList events={fetchedEvents} />
    </>
  );
}

export default EventsPage;
